import React, { Component } from 'react';
import {Container} from 'react-bootstrap';
import { Button } from 'react-bootstrap';
import { ButtonToolbar } from 'react-bootstrap';
import Navbar from 'react-bootstrap/Navbar'
import { Form } from 'react-bootstrap';
import { FormGroup } from 'react-bootstrap';
import { FormLabel } from 'react-bootstrap';
import { FormControl } from 'react-bootstrap';
import { Nav } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';
class Login extends Component {
   constructor(props){
     super(props)
     this.state = {
       currentPage : <LoginView func = {this}/>,
       userName: '',
       password: '',
       newProduct:'',
       newProblem: '',
       problemsubFields: []
     }
    this.handleClick = this.handleClick.bind(this);
    this.handleChange = this.handleChange.bind(this);
   }
  handleClick(event){
    if(this.state.userName === "root" && this.state.password === "My693914"){
        alert("Logged in lan");
        this.setState({currentPage: <ControlPanel func = {this}/>})
    }
    if(event.target.name === 'newProduct'){
        alert("new Product inserted");
        this.addProduct(this.state)
    }
  }
  handleChange(event){
      if(event.target.type === "email"){
        this.setState({userName: event.target.value });
      }

    if(event.target.type === "password"){
        this.setState({password: event.target.value });
    }
  }
  addProduct(product) {
    console.log(product.newProduct);
    fetch('http://localhost:4000/products/add',{
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Content-type': 'application/json'
      },
      body: product.newProduct
    })
    .then(({ data }) => {
      console.log(data)
    })
      .catch(err => console.error(err))
  }
 


  render() {
    return (
       
      this.state.currentPage
    );
  
  }
}
function LoginView(props){
    return (
        <Container>
            <Form>
        <Form.Group controlId="formGroupEmail">
          <Form.Label>User Name: </Form.Label>
          <Form.Control type="email" input = "userName" onChange = {props.func.handleChange}/>
        </Form.Group>
        <Form.Group controlId="formGroupPassword">
          <Form.Label>Password: </Form.Label>
          <Form.Control type="password" input = "password" onChange =  {props.func.handleChange} />
        </Form.Group>
      </Form>
      <Container>
         <Button  onClick={props.func.handleClick} name='login' variant="danger" size="lg" active >
         Login!
         </Button>
         </Container>
        </Container>

      
    );
}
function ControlPanel(props){
    return (
        <Container>
            <Form>
        <Form.Group controlId="formGroupEmail">
          <Form.Label>Product Name:  </Form.Label>
          <Form.Control type="text" input = "productName" onChange = {props.func.handleChange}/>
        </Form.Group>
        <Button  onClick={props.func.handleClick} name='newProduct' variant="danger" size="lg" active >
         Insert New Product!
         </Button>
         <hr></hr>
         <hr></hr>
        <hr></hr>
         <Form.Group controlId="formGroupEmail">
          <Form.Label> Problem Type:  </Form.Label>
          <Form.Control type="text" input = "newProblem" onChange = {props.func.handleChange}/>
          <Form.Label style= {{fontSize: 14}}> Problem SubFields: (Seperate subfields via comma-,- ie: sf1,sf2,sf3):  </Form.Label>
          <Form.Control style= {{fontSize: 14}} type="text" input = "newProblem" onChange = {props.func.handleChange}/>
        </Form.Group>
        <Button  onClick={props.func.handleClick} name='newProblem' variant="danger" size="lg" active >
         Insert New Problem Type!
         </Button>

      </Form>
      
        </Container>

      
    );
}

export default Login;
